import React from 'react'
import { Container } from "@mui/material";

const Contact = () => {


    return(
        <div style={{backgroundColor:'green'}}>
        <Container maxWidth='xl' sx={{display:'flex', justifyContent:'center', height:'75vh', backgroundColor:'green'}}>
            <h1>CONTACT</h1>
        </Container>
    </div>
    )
}

export default Contact
